pragma solidity ^0.8.19;
import "./Dice.sol";

contract DiceMarket {

    Dice diceContract;  
    uint256 commissionFee;
    uint256[] diceForSale;

    uint256 public numDices = 0;
    mapping(uint256 => uint256) public priceList;

    constructor(Dice diceAddress, uint256 fee) public {
        diceContract = diceAddress;
        commissionFee = fee;
    }

    function list(uint256 id, uint256 price) public 
    {
        require(price >= diceContract.getDiceValue(id) + commissionFee, "price too low!");
        require(msg.sender == diceContract.getDicePrevOwner(id));
        priceList[id] = price;
        diceForSale.push(id);  // dice
    }

    function unlist(uint256 id) public 
    {
        require(msg.sender == diceContract.getDicePrevOwner(id));
        diceContract.transfer(id, msg.sender);
        delete priceList[id];
        for (uint8 i = 0; i < diceForSale.length; i++)
        {
            if (diceForSale[i] == id)
            {
                delete diceForSale[i];
            }
        }
    }

    function checkPrice(uint256 id) public view returns (uint256) 
    {
        return priceList[id];
    }

    function buy(uint256 id) public payable
    {
        require(msg.value >= priceList[id] + commissionFee, "price too low!");
        for (uint8 i = 0; i < diceForSale.length; i++)
        {
            if (diceForSale[i] == id)
            {
                // address payable myaccount = address(uint160(diceContract.getDicePrevOwner(id)));  // address can explicitly converted to address payable
                payable(diceContract.getDicePrevOwner(id)).transfer(msg.value - commissionFee);
                diceContract.transfer(id, msg.sender);
                unlist(id);
                return;
            }
        }
        require(false, "No such dice for sale!");
    }

}
